const Header = (props) => {
  console.log(props)
  return <h1>{props.name}</h1>
}

const Part = (props) => {
  return (
    <div>
      <p>{props.name} {props.exercises}</p>
    </div>
  )
}

const Content = (props) => {
  return (
      <div>
      {/* <Part name={props[0].name} exercises={props[0].exercises}/>
